          <p>Medico Ricercatore con formazione ventennale in medicina d'emergenza-urgenza e formazione specialistica in medicina subacquea ed iperbarica. La sua attivit professionale integra ricerca scientifica avanzata, insegnamento universitario e pratica clinica con particolare competenza nell'innovazione terapeutica.</p>

